/** @format */

import React from "react";

const App = () => {
	return (
		<>
			{/* World
               <iframe
				width='100%'
				height='106%'
				frameborder='0px'
				scrolling='no'
				marginheight='0'
                marginwidth='0'
                style ={{marginTop: "-10vh"}}
				src='https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap'></iframe> */}

			<iframe
                title="India"
                className ="map"
				width='100%'
				height='106%'
				frameborder='0'
				scrolling='no'
				style={{ marginTop: "-10vh" }}
				src='https://www.openstreetmap.org/export/embed.html?bbox=65.96191406250001%2C8.754794702435618%2C99.62402343750001%2C33.578014746144014&amp;layer=cyclemap'></iframe>
		</>
		/* UK <iframe
				width='100%'
				height='106%'
				frameborder='0'
				scrolling='no'
				marginheight='0'
				marginwidth='0'
				style={{ marginTop: "-10vh" }}
				src='https://www.openstreetmap.org/export/embed.html?bbox=-12.458496093750002%2C49.97948776108648%2C4.372558593750001%2C57.868131763328826&amp;layer=cyclemap'></iframe>
        </>*/
		/* USA <iframe
				width='100%'
				height='106%'
				frameborder='0'
				scrolling='no'
				marginheight='0'
				marginwidth='0'
				style={{ marginTop: "-10vh" }}
				src='https://www.openstreetmap.org/export/embed.html?bbox=-183.515625%2C6.664607562172573%2C-48.86718750000001%2C74.4964131169431&amp;layer=cyclemap'></iframe>
        </>*/
	);
};

export default App;

